DELIMITER $$
CREATE TRIGGER `trg_bloodsugar_abnormal_alert` AFTER INSERT ON `bloodsugarreadings` FOR EACH ROW BEGIN
  IF NEW.status = 'abnormal' THEN
    VALUES (
      NEW.user_id,
      (SELECT specialist_id 
         FROM specialistpatient sp
         JOIN patients p ON sp.patient_id = p.patient_id
        WHERE p.user_id = NEW.user_id
        LIMIT 1),
      CONCAT('Abnormal reading detected: ', NEW.value, ' ', NEW.unit)
    );
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `trg_bsr_set_status` BEFORE INSERT ON `bloodsugarreadings` FOR EACH ROW BEGIN
  DECLARE v_status VARCHAR(15);

  -- Only set status if not provided
  IF NEW.status IS NULL OR NEW.status = '' THEN
    SELECT t.status
      INTO v_status
      FROM thresholds t
     WHERE t.user_id = NEW.user_id
       AND (t.min_value IS NULL OR NEW.value >= t.min_value)
       AND (t.max_value IS NULL OR NEW.value <= t.max_value)
     ORDER BY FIELD(t.status, 'abnormal','borderline','normal')
     LIMIT 1;

    IF v_status IS NULL THEN
      SET v_status = 'normal';
    END IF;

    SET NEW.status = v_status;
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `trg_classify_reading` BEFORE INSERT ON `bloodsugarreadings` FOR EACH ROW BEGIN
  DECLARE nmin DECIMAL(5,2); DECLARE nmax DECIMAL(5,2);
  DECLARE bmin DECIMAL(5,2); DECLARE bmax DECIMAL(5,2);

  SELECT min_value, max_value INTO nmin, nmax
    FROM Thresholds
   WHERE user_id = NEW.user_id AND status = 'normal'
   ORDER BY created_at DESC LIMIT 1;

  SELECT min_value, max_value INTO bmin, bmax
    FROM Thresholds
   WHERE user_id = NEW.user_id AND status = 'borderline'
   ORDER BY created_at DESC LIMIT 1;

  IF nmin IS NOT NULL AND nmax IS NOT NULL THEN
    IF NEW.value BETWEEN nmin AND nmax THEN
      SET NEW.status = 'normal';
    ELSEIF bmin IS NOT NULL AND bmax IS NOT NULL AND NEW.value BETWEEN bmin AND bmax THEN
      SET NEW.status = 'borderline';
    ELSE
      SET NEW.status = 'abnormal';
    END IF;
  END IF;
END
$$
DELIMITER ;

